import React from "react";

const Imagactive = () => {
  return (
    <div>
      <h2>HÌNH ẢNH HOẠT ĐỘNG</h2>
      <div className="gallery">
        <a target="_blank" href="img_5terre.jpg">
          <img
            style={{ height: 269, width: 358 }}
            src="https://techinplay.edu.vn/media/images/hinh_anh_robot_tieu_bieu/c36fcea9aa869a38cd15a2161dc85232.jpg"
            alt="Cinque Terre"
          />
        </a>
      </div>
      <div className="gallery">
        <a target="_blank" href="img_forest.jpg">
          <img
            style={{ height: 269, width: 358 }}
            src="https://techinplay.edu.vn/media/images/hinh_anh_robot_tieu_bieu/DP_540_10.jpg"
            alt="Northern Lights"
          />
        </a>
      </div>
      <div className="gallery">
        <a target="_blank" href="img_lights.jpg">
          <img
            style={{ height: 269, width: 358 }}
            src="https://techinplay.edu.vn/media/images/hinh_anh_robot_tieu_bieu/4-88668.jpg"
            alt="Northern Lights"
          />
        </a>
      </div>
    </div>
  );
};

export default Imagactive;
